import React from 'react';
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import { Route } from 'react-router-dom';
import './navigation.css';

const useStyles = makeStyles((theme) => ({
    buttons: {
        marginRight: theme.spacing(2),
    },
    start: {
        marginLeft: theme.spacing(2),
    },
    end: {
        marginRight: theme.spacing(14),
    }
}));

const Navigation = () => {
    const classes = useStyles();
    const start = props => {
        return (
            <Button className={classes.buttons} color="inherit" onClick={() => props.history.push('/start')}>
                Get Started
            </Button>
        )
    }
    const about = props => {
        return (
            <Button className={classes.buttons} color="inherit" onClick={() => props.history.push('/about')}>
                About
            </Button>
        )
    }
    return (
        <AppBar position="static" style={{ backgroundColor: "#011F30" }}>
            {/* <Toolbar> */}
            <div className={classes.start}>
                <Route path='/' component={start} />
            </div>
            <div className={classes.end}>
                <Route path='/' component={about} />
            </div>
            {/* </Toolbar> */}
        </AppBar>
    )
}

export default Navigation;
